import './App.css';
import React from "react";
import Icons from "./Icons";
import Main from "./Main";

function App() {
  return (
    <div className="App">
        <head>
            <link rel="shortcut icon" href="./logo.ico" />
        </head>
      <body>
        <Icons />
        <Main />
      </body>
    </div>
  );
}

export default App;
